import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.css";
import "../css/searchstyle.css";

class Buy extends Component {
  state = {};

  buySearchButtonClick = () => {
    window.location.href = "/buy";
  };

  addBuyButtonClick = () => {
    window.location.href = "/sell";
  };

  render() {
    return (
      <div>
        <div className="container">
          <header>
            <h2>
              <a href="/">
                <i className="ion-plane"></i> BLINK EXCHANGE
              </a>
            </h2>
            <nav>
              <ul>
                <li>
                  <a href="/sell" title="Sell">
                    Sell
                  </a>
                </li>

                <li>
                  <a href="/" title="Return to HOME Page">
                    Return to Home Page
                  </a>
                </li>
                <li>
                  <a href="/" title="LOG OUT">
                    LOG OUT
                  </a>
                </li>
              </ul>
            </nav>
          </header>
        </div>
        <body>
          <h1 align="center">Wanna Buy? </h1>

          <button
            onClick="window.location.href = 'buysearch.html';"
            className="btn third"
          >
            Search from existing ones
          </button>
          <button
            onClick="window.location.href = 'buypage1.html';"
            className="btn fourth"
          >
            Add a new item
          </button>
        </body>
      </div>
    );
  }
}

export default Buy;
